import React from "react";
import "../styles/tour-details.css";

const TourDetails = () => {
  return (
    <>
      <section>
        <Conatiner>
          <Row>
            <Col></Col>
          </Row>
        </Conatiner>
      </section>
    </>
  );
};

export default TourDetails;
